import React from "react";

class Login extends React.Component {
  render() {
    return (
      <form>
        <label>
          Email:
          <input type="text" placeholder="email@email.com" />
        </label>
        <label>
          Senha:
          <input type="text" placeholder="Senha" />
        </label>
        <input
          onSubmit={ev => {
            ev.preventDefault();
            this.props.handleSetState("times");
          }}
          type="submit"
        />
        <input
          onSubmit={ev => {
            ev.preventDefault();
            this.props.handleSetState("Signup");
          }}
          type="submit"
          value="fazer cadastro"
        />
      </form>
    );
  }
}

export default Login;
